class Solution:
    def isValid(self, s: str) -> bool:
        if s == "":
            return True
        parenthese = {
             "(": ")",
             "[": "]",
             "{": "}",
        }
        push_ops = set(parenthese.keys())
        pop_ops = set(parenthese.values())

        stack = []
        has_op = False
        for char in s.strip():
            char = char.strip()
            if not char:
                continue
            if char in push_ops:
                has_op = True
                stack.append(char)
            elif char in pop_ops:
                has_op = True
                try:
                    last = stack.pop()
                except IndexError:
                    return False
                if parenthese[last] != char:
                    return False
            else:
                continue
        print(f"final: {stack}")
        if has_op is True and stack == []:
            return True
        return False

s = Solution()

